import express from 'express';
import dotenv from 'dotenv/config';
import viewEngine from './bt1/viewEngine';
import mainRoutes from './bt1/routes/mainRoute';

const app = express();
const port = process.env.PORT
viewEngine(app);

app.use('/', mainRoutes);

app.listen(port, () => {
    console.log(`Example app listening on port ${port}`)
})
